import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  componentDidMount() {}

  List() {
    let result = [];
    axios
      .get("http://seeho.kro.kr:3010/json")
      .then(function(res) {
        res.data.map((data, i) =>{
            result.push(data);
            console.log(i);
        })
        
        console.log("result", result);
      })
      .catch(function(err) {
        console.log(err);
      });
    return (
        <>
        hi, List complete! 
        {result[0]}
        </>);
  }
  render() {
    console.log("ㅇ");
    return (
      <>
        {console.log("dd")}
        {this.List()}
        {console.log("dd1")}
      </>
    );
  }
}

export default Silkum;
